import './index.css';

function Home() {
    return (
        <div className="professorContainer">
            <div className="professorNav">
                <span className="logOut">
                    Log out
                </span>
                <span className="returnDashboard">
                    Dashboard
                </span>
                <span className="createProfComment">
                    Create new rate and comment
                </span>
            </div>
        </div>
    );
  }

  export default Home;
